\begin{tikzpicture}[x=0.5cm,y=0.5cm]

% Draw grid
\draw[help lines, step=0.5] (-2,-3) grid (6,4);

% Define triangle vertices (scalene triangle with vertex pointing left)
\coordinate (A) at (-1,1);  % Left vertex
\coordinate (B) at (4,3);   % Top right vertex  
\coordinate (C) at (3,-2);  % Bottom right vertex

% Draw triangle
\draw[thick, fill=LBlue, opacity=0.3] (A) -- (B) -- (C) -- cycle;

% Draw vertices
\node[vertex] at (A) {};
\node[vertex] at (B) {};
\node[vertex] at (C) {};

% Height from A to side BC (h1)
% First find the foot of perpendicular from A to BC
\coordinate (H1) at ($(B)!(A)!(C)$);
\draw[dashed, thick, red] (A) -- (H1);
\draw[line width=1pt] (H1) ++(-0.15,-0.1) rectangle ++(0.3,0.2);
\node[red] at ($(A)!0.5!(H1) + (0.3,0)$) {$h_1$};

% Height from B to side AC (h2)  
% Find the foot of perpendicular from B to AC
\coordinate (H2) at ($(A)!(B)!(C)$);
\draw[dashed, thick, blue] (B) -- (H2);
\draw[line width=1pt] (H2) ++(-0.1,-0.15) rectangle ++(0.2,0.3);
\node[blue] at ($(B)!0.5!(H2) + (-0.4,0.2)$) {$h_2$};

% Height from C to side AB (h3)
% Find the foot of perpendicular from C to AB  
\coordinate (H3) at ($(A)!(C)!(B)$);
\draw[dashed, thick, green!60!black] (C) -- (H3);
\draw[line width=1pt] (H3) ++(-0.15,-0.1) rectangle ++(0.3,0.2);
\node[green!60!black] at ($(C)!0.5!(H3) + (0.4,-0.3)$) {$h_3$};

% Extend sides slightly for clarity
\draw[thick] (A) -- (B);
\draw[thick] (B) -- (C);  
\draw[thick] (C) -- (A);

\end{tikzpicture}

\end{document}

