    minor x tick num=0,
    minor y tick num=0
]

% Original triangle ABC
\coordinate (A) at (1,2);
\coordinate (B) at (3,1);
\coordinate (C) at (2,4);

% Translated triangle A'B'C'
\coordinate (Ap) at (5,3);
\coordinate (Bp) at (7,2);
\coordinate (Cp) at (6,5);

% Draw original triangle
\draw[Blue, line width=1.5pt] (A) -- (B) -- (C) -- (A);

% Draw translated triangle
\draw[Red, line width=1.5pt] (Ap) -- (Bp) -- (Cp) -- (Ap);

% Translation arrow from centroid of ABC to centroid of A'B'C'
\coordinate (centroid) at (2,7/3);
\coordinate (centroidp) at (6,10/3);
\draw[Green, line width=2pt, ->] (centroid) -- (centroidp);

