\path [name path=RayOne, overlay] (LeftPoint) -- (\AngleOne:40);
\path [name path=RayTwo, overlay] ++(RightPoint) -- +(180-\AngleTwo:40);
\path [name intersections={of=RayOne and RayTwo}] (intersection-1) coordinate (TopPoint);

